import { IndexedDB } from 'react-indexed-db';

const DB: React.FC = () => {
  return (
    <IndexedDB
      name="MyDB"
      version={1}
      objectStoresMeta={[
        {
          store: 'teams',
          storeConfig: { keyPath: 'id', autoIncrement: true },
          storeSchema: [
            { name: 'name', keypath: 'name', options: { unique: false } },
            { name: 'dt', keypath: 'dt', options: { unique: false } }
          ]
        }
      ]}>
    </IndexedDB>
  );
};

export default DB;
